import React,{useState,useEffect} from "react"
import axios from "axios"
import Navbar from "./Navbar"
import "./pageManager.css"
function Manager(){
    const [posts,setPosts] =useState([])

    useEffect(()=> {
        axios.get("http://localhost:9002/admin")
        .then(res=>{
            console.log(res)
            setPosts(res.data)
        })
        .catch(err=>{
            console.log(err)
        })
    },[])
    return(
        <div>
            <Navbar/>
            <div className="bc-img">
                {posts.map(post=>(
                    <div>
                    <table style="width:100%">
                    <tr>
                      <th>Name</th>
                      <th>Email</th>
                      <th>Query</th>
                      <th>Solve Query</th>
                    </tr>
                    <tr>
                      <td>{post.name}</td>
                      <td>{post.email}</td>
                      <td>{post.query}</td>
                      <td>Solve Query of {post.name}</td>
                    </tr>
                  </table>
                  </div>
                ))}
            </div>
        </div>
    )
}

export default Manager;
